Taith Iolo a Pws i St Kilda

Nature Documentary hosted by Iolo Williams and Dewi Pws Morris, published by S4C in 2004 - Welsh narration


Information
------------------------------

A fascinating journey to St Kilda, Britain's most westerly isles, with Iolo Williams and Dewi 'Pws' Morris. While Iolo joins an important sea bird count and introduces us to the remarkable wildlife, Dewi traces the unique human history of the islands. First shown in 2004.

